import React from 'react'


const Header = (props) => {

  return (
    <h1>{props.name}</h1>
  )
}


const Part = (props) => {

  return (
    <p>{props.name} , {props.numberOfExercise}</p>
  )
}


const Content = (props) => {

  <div>
      <Part name = {props.parts[0]} numberOfExercise = {props.exercises[0]}/>
      <Part name = {props.parts[1]} numberOfExercise = {props.exercises[1]}/>
      <Part name = {props.parts[2]} numberOfExercise = {props.exercises[2]}/>
    </div>
}

const Total = (props) => {

  return (
    <p>Number of exercises:  {props.exercises[0]} + {props.exercises[1]} + {props.exercises[2]} </p>
  )
}



const App = () => {
  const course = 'Half Stack application development'
  const parts = ['Fundamentals of React', 'Using props to pass data', 'State of a component']
  const exercises  = [10, 7, 14]

  return (
    <div>
      <Header name = {course}/>
      <Content  parts = {parts} exercises={exercises}/>      
      <Total exercises = {exercises}/>
    </div>
  )
}

export default App
